ed = true;\nbool isStatSuccess         = false;\nenum PopCovForm covForm  = R;\n\n///////////////////////////////////////////////////////////////////\n// NONMEM Sepcific\nconst int nTheta          = 3; // length of theta vector\ndouble c_thetaIn[nTheta]  = { 3, .08, .04 };\nconst valarray<double> thetaIn( c_thetaIn, nTheta );\ndouble c_thetaUp[nTheta]  = { 5, .5, .9 };\nconst valarray<double> thetaUp( c_thetaUp, nTheta );\ndouble c_thetaLow[nTheta] = { .1, .008, .004 };\nconst valarray<double> thetaLow( c_thetaLow, nTheta );\nvalarray<double> thetaOut( nTheta );\n\nconst int nOmega         = 6; // #of elements in Omega matrix\nconst int dimOmega       = 3; // dimension of Omeaga matrix\ndouble c_omegaIn[nOmega] = { 6, .005, .0002, .3, .006, .4 };\nconst valarray<double> omegaIn( c_omegaIn, nOmega );\nvalarray<double> omegaOut( nOmega );\n\nconst int nSigma         = 1; // #of elements in Sigma matrix\nconst int dimSigma = 1; // order of Sigma matrix\nconst int nEps           = dimSigma;\ndouble c_sigmaIn[nSigma] = { .4 };\nconst valarray<double> sigmaIn ( c_sigmaIn, nSigma );\nvalarray<double> sigmaOut( nSigma );\n\nconst int nEta              = 3;\ndouble c_etaIn[nEta] = { 0.0, 0.0, 0.0 };\nconst valarray<double> etaIn ( c_etaIn, nEta );\nvalarray<double> etaOut( nEta );\nvalarray<double> etaAllOut( nEta * nPop );\n\n//\n///////////////////////////////////////////////////////////////////\n\n///////////////////////////////////////////////////////////////////\n//   NONMEM PRED Specific\nPred< CppAD::AD<double> > mPred(&set);\nenum PopPredModel::covStruct omegaStruct = PopPredModel::FULL;\nenum PopPredModel::covStruct sigmaStruct = PopPredModel::DIAGONAL;\nPopPredModel model( mPred,\n                    nTheta,\n                    thetaLow,\n                    thetaUp,\n                    thetaIn,\n                    nEta,\n                    etaIn,\n                    nEps,\n                    omegaStruct,\n                    omegaIn,\n                    sigmaStruct,\n                    sigmaIn );\n//\n///////////////////////////////////////////////////////////////////\n\nconst int nAlp = model.getNPopPar();\nconst int nB   = model.getNIndPar();\n\nvalarray<double> alpIn  ( nAlp );\nvalarray<double> alpUp  ( nAlp );\nvalarray<double> alpLow ( nAlp );\nvalarray<double> alpStep( nAlp );\nvalarray<double> alpOut ( nAlp );\ndouble           alpObjOut;\nvalarray<double> alpObj_alpOut    ( nAlp );\nvalarray<double> alpObj_alp_alpOut( nAlp * nAlp );\nmodel.getPopPar         ( alpIn );\nmodel.getPopParLimits   ( alpLow, alpUp );\nmodel.getPopParStep     ( alpStep );\n\nvalarray<double> bIn  ( nB * nPop );\nvalarray<double> biIn ( nB );\nvalarray<double> bUp  ( nB );\nvalarray<double> bLow ( nB );\nvalarray<double> bStep( nB );\nvalarray<double> bOut ( nB * nPop );\nfor( int i=0; i<nPop; i++ )\n{\n   model.selectIndividual( i ); \n   model.getIndPar( biIn );\n   bIn[ slice(i*nB, nB, 1) ] = biIn;\n}\nmodel.getIndParLimits ( bLow, bUp );\nmodel.getIndParStep   ( bStep );\n\nconst double popEps   = 0.0001;\nconst int    popMitr  = 100;\nconst int    popTrace = 1;\nOptimizer    popOpt( popEps, popMitr, popTrace );\n\nconst double indEps   = 0.0001;\nconst int    indMitr  = 100;\nconst int    indTrace = 1;\nOptimizer    indOpt( indEps, indMitr, indTrace );\n\nint c_N[nPop] = { 11, 11, 11, 11, 11, 11, 11, 11, 11, 11, 11, 11 };\nconst valarray<int> N( c_N, nPop );\nconst int nY = N.sum();\n\n/*******************************************************************/\n/*                                                                 */\n/*   Data Initialization                                           */\n/*                                                                 */\n/*******************************************************************/\ndouble c_y[] = { 0.74, 2.84, 6.57, 10.5, 9.66, 8.58, 8.36, 7.47, 6.89, 5.94, 3.28, 0, 1.72, 7.91, 8.31, 8.33, 6.85, 6.08, 5.4, 4.55, 3.01, 0.9, 0, 4.4, 6.9, 8.2, 7.8, 7.5, 6.2, 5.3, 4.9, 3.7, 1.05, 0, 1.89, 4.6, 8.6, 8.38, 7.54, 6.88, 5.78, 5.33, 4.19, 1.15, 0, 2.02, 5.63, 11.4, 9.33, 8.74, 7.56, 7.09, 5.9, 4.37, 1.57, 0, 1.29, 3.08, 6.44, 6.32, 5.53, 4.94, 4.02, 3.46, 2.78, 0.92, 0.15, 0.85, 2.35, 5.02, 6.58, 7.09, 6.66, 5.25, 4.39, 3.53, 1.15, 0, 3.05, 3.05, 7.31, 7.56, 6.59, 5.88, 4.73, 4.57, 3, 1.25, 0, 7.37, 9.03, 7.14, 6.33, 5.66, 5.67, 4.24, 4.11, 3.16, 1.12, 0.24, 2.89, 5.22, 6.41, 7.83, 10.21, 9.18, 8.02, 7.14, 5.68, 2.42, 0, 4.86, 7.24, 8, 6.81, 5.87, 5.22, 4.45, 3.62, 2.69, 0.86, 0, 1.25, 3.96, 7.82, 9.72, 9.75, 8.57, 6.59, 6.11, 4.57, 1.17 };\nvalarray<double> y( c_y, nY );\nhaveCompleteData = true;\n\n/*******************************************************************/\n/*                                                                 */\n/*   Parameter Estimation                                          */\n/*                                                                 */\n/*******************************************************************/\ntimeval optBegin, optEnd;\ndouble optTimeSec = 0.0;\nif( isOptRequested && haveCompleteData )\n{\n   gettimeofday( &optBegin, NULL );\n   try\n   {\n      fitPopulation( model,\n                     objective, \n                     N,\n                     y,\n                     popOpt,\n                     alpLow,\n                     alpUp,\n                     alpIn,\n                     alpStep,\n                    &alpOut,\n                     indOpt,\n                     bLow,\n                     bUp,\n                     bIn,\n                     bStep,\n                    &bOut,\n                    &alpObjOut,\n                    &alpObj_alpOut,\n                    &alpObj_alp_alpOut );\n      //FpErrorChecker::check( __LINE__, __FILE__ );\n      isOptSuccess = true;\n   }\n   catch( const SpkException& e )\n   {\n      oRuntimeError << e << endl;\n      cerr << e << endl;\n      isOptSuccess = false;\n      //FpErrorChecker::clear();\n   }\n   catch( ... )\n   {\n      char 