        &correlationOut, \n                     &coefficientOut, \n                     &confidenceOut );\n      //FpErrorChecker::check( __LINE__, __FILE__ );\n      isStatSuccess = true;\n   }\n   catch( const SpkException& e )\n   {\n      oRuntimeError << e << endl;\n      cerr << e << endl;\n      isStatSuccess = false;\n      //FpErrorChecker::clear();\n   }\n   catch( ... )\n   {\n      char message[] = \"Unknown exception: failed in statistics calculation!!!\";\n      oRuntimeError << message << endl;\n      cerr << message << endl;\n      isStatSuccess = false;\n      //FpErrorChecker::clear();\n   }\n   try\n   {\n      invCovOut = inverse( covOut, nAlp );\n      //FpErrorChecker::check( __LINE__, __FILE__ );\n   }\n   catch( const SpkException& e )\n   {\n      oRuntimeError << e << endl;\n      cerr << e << endl;\n      isStatSuccess = false;\n      //FpErrorChecker::clear();\n   }\n   catch( ... )\n   {\n      char message[] = \"Unknown exception: failed to invert the covariance of the final estimate of individual parameter!!!\";\n      oRuntimeError << message << endl;\n      cerr << message << endl;\n      isStatSuccess = false;\n      //FpErrorChecker::clear();\n   }\n   gettimeofday( &statEnd, NULL );\n   statTimeSec = difftime( statEnd.tv_sec, statBegin.tv_sec );\n}\noRuntimeError.close();\n\n/*******************************************************************/\n/*                                                                 */\n/*   ReportML Document                                             */\n/*                                                                 */\n/*******************************************************************/\nofstream oResults( \"result.xml\" );\nif( !oResults.good() )\n{\n   fprintf( stderr, \"Failed to open a file, %s !!!\", \"result.xml\" );\n   return FILE_ACCESS_FAILURE;\n}\noResults << \"<?xml version=\\\"1.0\\\"?>\" << endl;\noResults << \"<spkreport>\" << endl;\n\nif( !(haveCompleteData && isOptSuccess && isS