ear();\n  }\n  gettimeofday( &optEnd, NULL );\n  optTimeSec = difftime( optEnd.tv_sec, optBegin.tv_sec );\n\n  //////////////////////////////////////////////////////////////////////\n  //   NONMEM Specific\n  if( isOptSuccess || !isOptSuccess )\n  {\n     valarray<double> ROut( nY * nY );\n     model.getTheta( thetaOut );\n     model.getOmega( omegaOut );\n     model.setIndPar( bOut );\n     model.dataVariance( ROut );\n     for( int j=0; j<nY; j++ )\n        set.data[0]->res[j]  = y[j] - set.data[0]->pred[j];\n     set.data[0]->wres = wres( nY, ROut, set.data[0]->res ); \n  }\n  //\n  //////////////////////////////////////////////////////////////////////\n}\n\n/*******************************************************************/\n/*                                                                 */\n/*   ReportML Document                                             */\n/*                                                                 */\n/*******************************************************************/\nofstream oResults( \"result.xml\" );\nif( !oResults.good() )\n{\n   fprintf( stderr, \"Failed to open a file, %s !!!\", \"result.xml\" );\n   return FILE_ACCESS_FAILURE;\n}\noResults << \"<?xml version=\\\"1.0\\\"?>\" << endl;\noResults << \"<spkreport>\" << endl;\n\nchar buf[ SpkError::maxMessageLen() ];\nifstream iRuntimeError( \"spk_error.tmp\" );\noResults << \"<error_message>\" << endl;\nwhile( iRuntimeError.good() )\n{\n   iRuntimeError.getline(buf, SpkError::maxMessageLen() );\n   oResults << buf << endl;\n}\noResults << \"</error_message>\" << endl;\niRuntimeError.close();\n\nif( !haveCompleteData )\n{\n   oResults << \"</spkreportML>\" << endl;\n   oResults.close();\n   return OTHER_FAILURE;\n}\n\noResults << \"<ind_analysis_result>\" << endl;\n\noResults << \"<ind_opt_result elapsedtime=\\\"\" << optTimeSec << \"\\\">\" << endl;\noResults << \"<ind_obj_out>\" << endl;\noResults << \"<value>\" << bObjOut << \"</value>\" << endl;\noResults << \"</ind_obj_out>\" << endl;\n\n//////////////////////////////////////////////////////////////////////\n//    NONMEM Specific\noResults << \"<theta_out>\" << endl;\nfor( int i=0; i<nTheta; i++ )\n{\n   oResults << \"<value>\" << thetaOut[i] << \"</value>\" << endl;\n}\noResults << \"</theta_out>\" << endl;\noResults << \"<omega_out>\" << endl;\nfor( int i=0; i<nOmega; i++ )\n{\n   oResults << \"<value>\" << omegaOut[i] << \"</value>\" << endl;\n}\noResults << \"</omega_out>\" << endl;\n//\n//////////////////////////////////////////////////////////////////////\n\noResults << \"</ind_opt_result>\" << endl;\n\noResults << \"</ind_analysis_result>\" << endl;\n\noResults << \"<presentation_data>\" << endl;\noResults << \"<data_labels>\" << endl;\noResults << \"<label name=\\\"ID\\\"/>\" << endl;\n\n///////////////////////////////////////////////////////////////////\n//  Data Set Specific\noResults << \"<label name=\\\"b1\\\"/>\" << endl;\noResults << \"<label name=\\\"b2\\\"/>\" << endl;\noResults << \"<label name=\\\"b3\\\"/>\" << endl;\noResults << \"<label name=\\\"b4\\\"/>\" << endl;\noResults << \"<label name=\\\"b5\\\"/>\" << endl;\noResults << \"<label name=\\\"b6\\\"/>\" << endl;\noResults << \"<label name=\\\"b7\\\"/>\" << endl;\noResults << \"<label name=\\\"b8\\\"/>\" << endl;\noResults << \"<label name=\\\"eta\\\"/>\" << endl;\noResults << \"<label name=\\\"f\\\"/>\" << endl;\noResults << \"<label name=\\\"omega\\\"/>\" << endl;\noResults << \"<label name=\\\"pred\\\"/>\" << endl;\noResults << \"<label name=\\\"res\\\"/>\" << endl;\noResults << \"<label name=\\\"theta\\\"/>\" << endl;\noResults << \"<label name=\\\"wres\\\"/>\" << endl;\noResults << \"<label name=\\\"x\\\"/>\" << endl;\noResults << \"<label name=\\\"y\\\"/>\" << endl;\n//\n///////////////////////////////////////////////////////////////////\noResults << \"</data_labels>\" << endl;\nfor( int j=0, cnt=1; j<nY; j++, cnt++ )\n{\n   ///////////////////////////////////////////////////////////////////\n   //\n 