ude <spk/fitIndividual.h>\n#include <spk/Optimizer.h>\n#include \"IndData.h\"\n#include \"DataSet.h\"\n\n#include <spk/multiply.h>\n#include <spk/cholesky.h>\n///////////////////////////////////////////////////////////////////////////////////\n//   NONMEM PRED SPECIFIC\n#include \"Pred.h\"\n#include <spkpred/IndPredModel.h>\n#include <cppad/include/CppAD.h>\n//\n///////////////////////////////////////////////////////////////////////////////////\n\nusing SPK_VA::valarray;\nusing namespace std;\n\nenum RETURN_CODE { SUCCESS=0, CONVERGENCE_FAILURE=1, FILE_ACCESS_FAILURE=2, OTHER_FAILURE };\n\nconst vector<CppAD::AD<double> > wres( int n,\n                                       const valarray<double> & Ri,\n                                       const vector  < CppAD::AD<double> > & residual )\n{\n   assert( Ri.size() == n * n );\n   assert( residual.size() == n );\n   valarray<double> r( n );\n   for( int i=0; i<n; i++ ) r[i] = CppAD::Value( residual[i] );\n   valarray<double> C( 0.0, n * n );\n   C = cholesky( Ri, n );\n   valarray<double> w = multiply( C, n, r, 1 );\n   vector< CppAD::AD<double> > Cr(n);\n   for( int i=0; i<n; i++ ) Cr[i] = w[i];\n   return Cr;\n}\n\nint main( int argc, const char argv[] )\n{\n/*******************************************************************/\n/*                                                                 */\n/*   Set up                                                        */\n/*                                                                 */\n/*******************************************************************/\nofstream oRuntimeError( \"spk_error.tmp\" );\nif( !oRuntimeError.good() )\n  {\n      fprintf( stderr, \"%s:%d: Failed to create a temporary file, %s.\",  __FILE__, __LINE__, \"spk_error.tmp\" );\n      return FILE_ACCESS_FAILURE;\n  }\n\n//FpErrorChecker fperror;\n\nconst int nY = 236;\nDataSet< CppAD::AD<double> > set;\n\nconst bool isSimRequested = false;\nbool haveCompleteData = true;\n\nconst bool isOptReque