 std;\n\nenum RETURN_CODE { SUCCESS=0, CONVERGENCE_FAILURE=1, FILE_ACCESS_FAILURE=2, OTHER_FAILURE };\n\nconst vector<CppAD::AD<double> > wres( int n,\n                                       const valarray<double> & Ri,\n                                       const vector  < CppAD::AD<double> > & residual )\n{\n   assert( Ri.size() == n * n );\n   assert( residual.size() == n );\n   valarray<double> r( n );\n   for( int i=0; i<n; i++ ) r[i] = CppAD::Value( residual[i] );\n   valarray<double> C( 0.0, n * n );\n   C = cholesky( Ri, n );\n   valarray<double> w = multiply( C, n, r, 1 );\n   vector< CppAD::AD<double> > Cr(n);\n   for( int i=0; i<n; i++ ) Cr[i] = w[i];\n   return Cr;\n}\n\nint main( int argc, const char argv[] )\n{\n/*******************************************************************/\n/*                                                                 */\n/*   Set up                                                        */\n/*                                                                 */\n/*******************************************************************/\nofstream oRuntimeError( \"spk_error.tmp\" );\nif( !oRuntimeError.good() )\n  {\n      fprintf( stderr, \"%s:%d: Failed to create a temporary file, %s.\",  __FILE__, __LINE__, \"spk_error.tmp\" );\n      return FILE_ACCESS_FAILURE;\n  }\n\n//FpErrorChecker fperror;\n\nconst int nY = 151;\nDataSet< CppAD::AD<double> > set;\n\nconst bool isSimRequested = false;\nbool haveCompleteData = true;\n\nconst bool isOptRequested = true;\nbool isOptSuccess  = false;\n\nconst bool isStatRequested = false;\nbool isStatSuccess = true;\n\n//////////////////////////////////////////////////////////////////////\n//   NONMEM Specific\n\nconst int nTheta = 5;\n\ndouble c_thetaIn[nTheta] = { 2, -0.1, 0.003, -0.001, 0.00001 };\nconst valarray<double> thetaIn ( c_thetaIn, nTheta );\n\ndouble c_thetaUp[nTheta] = { 20, -0.01, 0.03, -0.0001, 0.0001 };\nconst valarray<double> thetaUp  ( c_thetaUp, nTheta );\n\ndouble c_thetaLow[nTheta] = { 0.2, -1, 0.0003, -0.01, 0.000001 };\nconst valarray<double> thetaLow ( c_thetaLow, nTheta );\n\nvalarray<double> thetaStep( nTheta );\n\nvalarray<double> thetaOut( nTheta );\n\nconst int nEta     = 1;\nconst int nOmega   = 1; // #of elements in Omega matrix\nconst int dimOmega = 1; // dimension of Omeaga matrix\ndouble c_omegaIn[nOmega] = { 1 };\nconst valarray<double> omegaIn( c_omegaIn, nOmega );\nvalarray<double> omegaOut( nOmega );\n\n//\n//////////////////////////////////////////////////////////////\n\n//////////////////////////////////////////////////////////////////////\n//   NONMEM PRED Specific\nPred<CppAD::AD<double> > mPred(&set);\nenum IndPredModel::covStruct omegaStruct = IndPredModel::DIAGONAL;\nIndPredModel model( mPred, (int)nTheta, thetaLow, thetaUp, thetaIn, (int)nEta, omegaStruct, omegaIn );\n//\n//////////////////////////////////////////////////////////////////////\n\nconst int nB = model.getNIndPar();\nvalarray<double> bIn  ( nB );\nvalarray<double> bStep( nB );\nvalarray<double> bLow ( nB );\nvalarray<double> bUp  ( nB );\nvalarray<double> bOut ( nB );\ndouble           bObjOut;\nvalarray<double> bObj_bOut( nB );\nvalarray<double> bObj_b_bOut( nB * nB );\n\nconst double eps   = 0.001;\nconst int    mitr  = 450;\nconst int    trace = 1;\nOptimizer    opt( eps, mitr, trace );\n\nmodel.getIndPar       ( bIn );\nmodel.getIndParLimits ( bLow, bUp );\nmodel.getIndParStep   ( bStep );\n\n/*******************************************************************/\n/*                                                                 */\n/*   Data Initialization                                           */\n/*                                                                 */\n/*******************************************************************/\ndouble c_y[] = { 0.0082, 0.0112, 0.0149, 0.0198, 0.0248, 0.0324, 0.042, 0.0549, 0.0719, 0.0963, 0.1291, 0.171, 0.2314, 0.3227, 0.4809, 0.7084, 1.022, 1.458, 1.952, 2.541, 3.223, 3.999, 4.852, 5.732, 6.7