2, 0.506641, 0.513532, 0.461144, 0.461699, 0.471568, 0.427893, 0.434887, 0.438864, 0.386998, 0.38951, 0.33382, 0.337731, 0.339603, 0.295319, 0.296257, 0.297989, 0.251809, 0.252141, 0.252429 };\nvalarray<double> y( c_y, nY );\nhaveCompleteData = true;\n\n/*******************************************************************/\n/*                                                                 */\n/*   Parameter Estimation                                          */\n/*                                                                 */\n/*******************************************************************/\ntimeval optBegin, optEnd;\ndouble optTimeSec = 0.0;\nif( isOptRequested && haveCompleteData )\n{\n  gettimeofday( &optBegin, NULL );\n  try\n  {\n     fitIndividual( model,\n                    y,\n                    opt,\n                    bLow,\n                    bUp,\n                    bIn,\n                    bStep,\n                   &bOut,\n                   &bObjOut,\n                   &bObj_bOut,\n                   &bObj_b_bOut,\n                    false );\n     //FpErrorChecker::check( __LINE__, __FILE__ );\n     isOptSuccess = true;\n  }\n  catch( const SpkException& e )\n  {\n     oRuntimeError << e << endl;\n     cerr << e << endl;\n     isOptSuccess = false;\n     //FpErrorChecker::clear();\n  }\n  catch( ... )\n  {\n     char message[] = \"Unknown exception: failed in parameter estimation!!!\";\n     oRuntimeError << message << endl;\n     cerr << message << endl;\n     isOptSuccess = false;\n     //FpErrorChecker::clear();\n  }\n  gettimeofday( &optEnd, NULL );\n  optTimeSec = difftime( optEnd.tv_sec, optBegin.tv_sec );\n\n  //////////////////////////////////////////////////////////////////////\n  //   NONMEM Specific\n  if( isOptSuccess || !isOptSuccess )\n  {\n     valarray<double> ROut( nY * nY );\n     model.getTheta( thetaOut );\n     model.getOmega( omegaOut );\n     model.setIndPar( bOut );\n     model.dataVariance( ROut );\n     for( int j=0; j<nY; j++ )\n        set.data[0]->RES[j] = y[j] - set.data[0]->PRED[j];\n     set.data[0]->WRES = wres( nY, ROut, set.data[0]->RES ); \n  }\n  //\n  //////////////////////////////////////////////////////////////////////\n}\n/*******************************************************************/\n/*                                                                 */\n/*   Statistics                                                    */\n/*                                                                 */\n/*******************************************************************/\ntimeval statBegin, statEnd;\ndouble statTimeSec = 0.0;\nvalarray<double> covOut( nB * nB );\nvalarray<double> seOut( nB );\nvalarray<double> correlationOut( nB * nB );\nvalarray<double> coefficientOut( nB );\nvalarray<double> confidenceOut( 2 * nB );\nvalarray<double> invCovOut( nB * nB );\nvalarray<double> f_bOut( nY * nB );\nvalarray<double> R_bOut( nY * nY * nB );\nvalarray<double> RInvOut( nY * nY );\nif( isStatRequested && haveCompleteData && isOptSuccess )\n{\n   model.setIndPar( bOut );\n   model.dataMean_indPar( f_bOut );\n   model.dataVariance_indPar( R_bOut );\n   model.dataVarianceInv( RInvOut );\n   gettimeofday( &statBegin, NULL );\n   try\n   {\n      indStatistics( bOut, \n                     f_bOut,\n                     R_bOut,\n                     RInvOut,\n                     &covOut, \n                     &seOut, \n                     &correlationOut, \n                     &coefficientOut, \n                     &confidenceOut );\n      //FpErrorChecker::check( __LINE__, __FILE__ );\n      isStatSuccess = true;\n   }\n   catch( const SpkException& e )\n   {\n      oRuntimeError << e << endl;\n      cerr << e << endl;\n      isStatSuccess = false;\n      //FpErrorChecker::clear();\n   }\n   catch( ... )\n   {\n      char message[] = \"Unknown exception: failed in statistics calculation!!!\";\n      oRuntimeError << message << endl;\n      cerr << message << endl;\n      isStatSuccess = false;\n      //FpErrorChecker::clear();\n   }\n\n   try\n   {\n      invCovOut = inverse( covOut, nB );\n      //FpErrorChecker::check( __LINE__, __FILE__ );\n   }\n   catch( const SpkException& e )\n   {\n      oRuntimeError << e << endl;\n      cerr << e << endl;\n      isStatSuccess = false;\n      //FpErrorChecker::clear();\n   }\n   catch( ... )\n   {\n      char message[] = \"Unknown exception: failed to invert the covariance of the final estimate of individual parameter!!!\";\n      oRuntimeError << message << endl;\n      cerr << message << endl;\n      isStatSuccess = false;\n      //FpErrorChecker::clear();\n   }\n   gettimeofday( &statEnd, NULL );\n   statTimeSec = difftime( statEnd.tv_sec, statBegin.tv_sec );\n}\n\noRuntimeError.close();\n/*******************************************************************/\n/*                                                                 */\n/*   ReportML Document                                             */\n/*                                                                 */\n/*******************************************************************/\nofstream oResults( \"result.xml\" );\nif( !oResults.good() )\n{\n   fprintf( stderr, \"Failed to open a file, %s !!!\", \"result.xml\" );\n   return FILE_ACCESS_FAILURE;\n}\noResults << \"<?xml version=\\\"1.0\\\"?>\" << endl;\noResults << \"<spkreport>\" << endl;\n\nif( !(haveCompleteData && isOptSuccess && isStatSuccess) )\n{\n   char buf[ SpkError::maxMessageLen() ];\n   ifstream iRuntimeError( \"spk_error.tmp\" );\n   oResults << \"<error_message>\" << endl;\n   while( iRuntimeError.getline(buf, SpkError::maxMessageLen()) )\n   {\n      oResults << buf << endl;\n   }\n   oResults << \"</error_message>\" << endl;\n   iRuntimeError.close();\n}\nremove( \"spk_error.tmp\" );\n\nif( !haveCompleteData )\n{\n   oResults << \"</spkreport>\" << endl;\n   oResults.close();\n   return OTHER_FAILURE;\n}\n\noResults << \"<ind_analysis_result>\" << endl;\n\noResults << \"<ind_opt_result elapsedtime=\\\"\" << optTimeSec << \"\\\">\" << endl;\noResults << \"<ind_obj_out>\" << endl;\noResults << \"<value>\" << bObjOut << \"</value>\" << endl;\noResults << \"</ind_obj_out>\" << endl;\n\n//////////////////////////////////////////////////////////////////////\n//    NONMEM Specific\noResults << \"<theta_out length=\\\"\" << nTheta << \"\\\">\" << endl;\nfor( int i=0; i<nTheta; i++ )\n{\n   oResults << \"<value>\" << thetaOut[i] << \"</value>\" << endl;\n}\noResults << \"</theta_out>\" << endl;\noResults << \"<omega_out dimension=\\\"\" << dimOmega << \"\\\" struct=\\\"block\\\">\" << endl;\nfor( int i=0; i<nOmega; i++ )\n{\n   oResults << \"<value>\" << omegaOut[i] << \"</value>\" << endl;\n}\noResults << \"</omega_out>\" << endl;\n//\n//////////////////////////////////////////////////////////////////////\n\noResults << \"</ind_opt_result>\" << endl;\n\noResults << \"<ind_stat_result elapsedtime=\\\"\" << statTimeSec << \"\\\">\" << endl;\nint covElemNum = 10;\noResults << \"<ind_covariance_out struct=\\\"block\\\" dimension=\\\"\" << nB << \"\\\">\" << endl;\nfor( int i=0; i<covElemNum; i++ )\n{\noResults << \"   <value>\" << covOut[i] << \"</value>\" << endl;\n}\noResults << \"</ind_covariance_out>\" << endl;\noResults << \"<ind_inverse_covariance_out struct=\\\"block\\\" dimension=\\\"\" << nB << \"\\\">\" << endl;\nfor( int i=0; i<covElemNum; i++ )\n{\noResults << \"   <value>\" << invCovOut[i] << \"</value>\" << endl;\n}\noResults << \"</ind_inverse_covariance_out>\" << endl;\noResults << \"<ind_stderror_out length=\\\"\" << nB << \"\\\">\" << endl;\nfor( int i=0; i<nB; i++ )\n{\noResults << \"   <value>\" << seOut[i] << \"</value>\" << endl;\n}\noResults << \"</ind_stderror_out>\" << endl;\noResults << \"<ind_correlation_out struct=\\\"block\\\" dimension=\\\"\" << nB << \"\\\">\" << endl;\nfor( int i=0; i<covElemNum; i++ )\n{\noResults << \"   <value>\" << correlationOut[i] << \"</value>\" << endl;\n}\noResults << \"</ind_correlation_out>\" << endl;\noResults << \"<ind_coefficient_out length=\\\"\" << nB << \"\\\">\" << endl;\nfor( int i=0; i<nB; i++ )\n{\noResults << \"   <value>\" << coefficientOut[i] << \"</value>\" << endl;\n}\noResults << \"</ind_coefficient_out>\" << endl;\noResults << \"<ind_confidence_out length=\\\"\" << nB*2 << \"\\\">\" << endl;\nfor( int i=0; i<nB*2; i++ )\n{\noResults << \"   <value>\" << confidenceOut[i] << \"</value>\" << endl;\n}\noResults << \"</ind_confidence_out>\" << endl;\noResults << \"</ind_stat_result>\" << endl;\n\noResults << \"</ind_analysis_result>\" << endl;\n\noResults << \"<presentation_data rows=\\\"\" << nY << \"\\\" \";\noResults << \"columns=\\\"19\\\">\" << endl;\noResults << \"<data_labels>\" << endl;\noResults << \"<label name=\\\"ID\\\"/>\" << endl;\n\n///////////////////////////////////////////////////////////////////\n//  Data Set Specific\noResults << \"<label name=\\\"B1\\\"/>\" << endl;\noResults << \"<label name=\\\"B2\\\"/>\" << endl;\noResults << \"<label name=\\\"B3\\\"/>\" << endl;\noResults << \"<label name=\\\"B4\\\"/>\" << endl;\noResults << \"<label name=\\\"DV\\\"/>\" << endl;\noResults << \"<label name=\\\"ETA(1)\\\"/>\" << endl;\noResults << \"<label name=\\\"F\\\"/>\" << endl;\noResults << \"<label name=\\\"MDV\\\"/>\" << endl;\noResults << \"<label name=\\\"PRED\\\"/>\" << endl;\noResults << \"<label name=\\\"RES\\\"/>\" << endl;\noResults << \"<label name=\\\"THETA(1)\\\"/>\" << endl;\noResults << \"<label name=\\\"THETA(2)\\\"/>\" << endl;\noResults << \"<label name=\\\"THETA(3)\\\"/>\" << endl;\noResults << \"<label name=\\\"THETA(4)\\\"/>\" << endl;\noResults << \"<label name=\\\"TIME\\\"/>\" << endl;\noResults << \"<label name=\\\"WRES\\\"/>\" << endl;\noResults << \"<label name=\\\"X\\\"/>\" << endl;\noResults << \"<label name=\\\"Y\\\"/>\" << endl;\n//\n///////////////////////////////////////////////////////////////////\noResults << \"</data_labels>\" << endl;\nfor( int j=0, cnt=1; j<nY; j++, cnt++