INSERT INTO model VALUES (1,'model 1','test model 1','head	1.1;\naccess;\nsymbols;\nlocks; strict;\ncomment	@# @;\n\n\n1.1\ndate	2004.04.05.13.22.41;	author vicini;	state Exp;\nbranches;\nnext	;\n\n\ndesc\n@@\n\n\n1.1\nlog\n@@\ntext\n@$PROBLEM THEOPHYLLINE POPULATION DATA\n$DATA THEO\n$INPUT ID AMT=DOSE TIME DV=CP WT\n$PRED \n;THETA(1)=MEAN ABSORPTION RATE CONSTANT (1/HR)\n;THETA(2)=MEAN ELIMINATION RATE CONSTANT (1/HR)\n;THETA(3)=SLOPE OF CLEARANCE VS WEIGHT RELATIONSHIP (LITERS/HR/KG)\n;DOSE=WT-ADJUSTED DOSE (MG/KG)\n;DS=NON-WT-ADJUSTED DOSE (MG)\n   IF (DOSE.NE.0) THEN\n      DS=DOSE*WT\n      W=WT\n   ENDIF\n   KA=THETA(1)+ETA(1)\n   KE=THETA(2)+ETA(2)\n   CL=THETA(3)*W+ETA(3)\n   D=EXP(-KE*TIME)-EXP(-KA*TIME)\n   E=CL*(KA-KE)\n   F=DS*KE*KA/E*D\n   Y=F+EPS(1)\n$THETA \n(.1,3,5)\n(.008,.08,.5)\n(.004,.04,.9)\n$OMEGA BLOCK(3) 6 .005 .0002 .3 .006 .4\n$SIGMA DIAGONAL(1) .4\n$ESTIMATION METHOD=0 SIGDIGITS=3 MAXEVALS=450 PRINT=5\n$COVARIANCE\n$TABLE ID DOSE WT TIME\n$SCATTERPLOT RES WRES VS TIME BY ID FROM 1 TO 900 NOABS0 NOORD0\n@\n',3);
