INSERT INTO model VALUES (7,'MGH17_2 Version2','http://www.itl.nist.gov/div898/strd/nls/data/mgh17.shtml','head	1.1;\naccess;\nsymbols;\nlocks; strict;\ncomment	@# @;\n\n\n1.1\ndate	2004.04.20.10.04.06;	author vicini;	state Exp;\nbranches;\nnext	;\n\n\ndesc\n@@\n\n\n1.1\nlog\n@@\ntext\n@$PROBLEM MGH17_2\n$DATA mgh17.txt\n$INPUT TIME DV\n$PRED \nb1 = THETA(1)\nb2 = THETA(2)\nb3 = THETA(3)\nb4 = THETA(4)\nb5 = THETA(5)\nx = TIME\nF = b1 + b2*exp(-x*b4) + b3*exp(-x*b5)\nY = F + ETA(1)\n$THETA \n(0.05,0.5,5)\n(0.15,1.5,15)\n(-10,-1,-0.1)\n(0.001,0.01,0.1)\n(0.002,0.02,0.2)\n$OMEGA DIAGONAL(1) 1\n$ESTIMATION METHOD=0 SIGDIGITS=3 MAXEVALS=450 PRINT=5\n$COVARIANCE\n$TABLE TIME F FILE=mgh17_2.out\n$SCATTERPLOT TIME VS DV PRED FROM 1 TO 900 UNIT ABS0 ORD0\n$SCATTERPLOT PRED VS DV FROM 1 TO 900 UNIT ABS0 ORD0\n@\n',3);
INSERT INTO model VALUES (8,'misra1c','http://www.itl.nist.gov/div898/strd/nls/data/misra1c.shtml','head	1.1;\naccess;\nsymbols;\nlocks; strict;\ncomment	@# @;\n\n\n1.1\ndate	2004.04.20.10.09.16;	author vicini;	state Exp;\nbranches;\nnext	;\n\n\ndesc\n@@\n\n\n1.1\nlog\n@@\ntext\n@$PROBLEM MISRA1C_1\n$DATA misra1c.txt\n$INPUT TIME DV\n$PRED \nb1 = THETA(1)\nb2 = THETA(2)\nx = TIME\nF = b1 * (1-(1+2*b2*x)**(-.5))  \nY = F + ETA(1)\n$THETA \n(50,500,5000)\n(0.00001,0.0001,0.001)\n$OMEGA DIAGONAL(1) 1\n$ESTIMATION METHOD=0 SIGDIGITS=3 MAXEVALS=450 PRINT=5\n$COVARIANCE\n$TABLE TIME F FILE=MISRA1C_1.out\n@\n',3);
INSERT INTO model VALUES (9,'misra1c_2 version 2','http://www.itl.nist.gov/div898/strd/nls/data/misra1c.shtml','head	1.1;\naccess;\nsymbols;\nlocks; strict;\ncomment	@# @;\n\n\n1.1\ndate	2004.04.20.10.14.56;	author vicini;	state Exp;\nbranches;\nnext	;\n\n\ndesc\n@@\n\n\n1.1\nlog\n@@\ntext\n@$PROBLEM MISRA1C_2\n$DATA misra1c.txt\n$INPUT TIME DV\n$PRED \nb1 = THETA(1)\nb2 = THETA(2)\nx = TIME\nF = b1 * (1-(1+2*b2*x)**(-.5))  \nY = F + ETA(1)\n$THETA \n(60,600,6000)\n(0.00002,0.0002,0.002)\n$OMEGA DIAGONAL(1) 1\n$ESTIMATION METHOD=0 SIGDIGITS=3 MAXEVALS=450 PRINT=5\n$COVARIANCE\n$TABLE F TIME FILE=misra1c_2.out\n@\n',3);
INSERT INTO model VALUES (10,'MISRA1D','http://www.itl.nist.gov/div898/strd/nls/data/misra1d.shtml','head	1.1;\naccess;\nsymbols;\nlocks; strict;\ncomment	@# @;\n\n\n1.1\ndate	2004.04.20.10.19.09;	author vicini;	state Exp;\nbranches;\nnext	;\n\n\ndesc\n@@\n\n\n1.1\nlog\n@@\ntext\n@$PROBLEM MISRA1D_1\n$DATA misra1d.txt\n$INPUT TIME DV\n$PRED \nb1 = THETA(1)\nb2 = THETA(2)\nx = TIME\nF = b1*b2*x*((1+b2*x)**(-1))\nY = F + ETA(1)\n$THETA \n(50,500,5000)\n(0.00001,0.0001,0.001)\n$OMEGA DIAGONAL(1) 1\n$ESTIMATION METHOD=0 SIGDIGITS=3 MAXEVALS=450 PRINT=5\n$COVARIANCE\n$TABLE TIME x FILE=misra1d_1.out\n@\n',3);
INSERT INTO model VALUES (11,'MISRA1D_2 Version 2','http://www.itl.nist.gov/div898/strd/nls/data/misra1d.shtml','head	1.1;\naccess;\nsymbols;\nlocks; strict;\ncomment	@# @;\n\n\n1.1\ndate	2004.04.20.10.22.17;	author vicini;	state Exp;\nbranches;\nnext	;\n\n\ndesc\n@@\n\n\n1.1\nlog\n@@\ntext\n@$PROBLEM MISRA1D_2\n$DATA misra1d.txt\n$INPUT TIME DV\n$PRED \nb1 = THETA(1)\nb2 = THETA(2)\nx = TIME\nF = b1*b2*x*((1+b2*x)**(-1))\nY = F + ETA(1)\n$THETA \n(45,450,4500)\n(0.00003,0.0003,0.003)\n$OMEGA DIAGONAL(1) 1\n$ESTIMATION METHOD=0 SIGDIGITS=3 MAXEVALS=450 PRINT=5\n$COVARIANCE\n$TABLE TIME F FILE=misra1d_2.out\n@\n',3);
INSERT INTO model VALUES (12,'nelson_2 Version 2','http://www.itl.nist.gov/div898/strd/nls/data/nelson.shtml','head	1.1;\naccess;\nsymbols;\nlocks; strict;\ncomment	@# @;\n\n\n1.1\ndate	2004.04.20.10.41.03;	author vicini;	state Exp;\nbranches;\nnext	;\n\n\ndesc\n@@\n\n\n1.1\nlog\n@@\ntext\n@$PROBLEM NELSON_2\n$DATA nelson.txt\n$INPUT TIME x2 DV\n$PRED \nb1 = THETA(1)\n\nb2 = THETA(2)\n\nb3 = THETA(3)\n\nx1 = TIME\n\nF = exp ( b1 - b2*x1 * exp (-b3 * x2 ) )\n\nY = F + ETA(1)\n$THETA \n(0.25,2.5,25)\n(0.0000000005,0.000000005,0.00000005)\n(-0.5,-0.05,-0.005)\n$OMEGA DIAGONAL(1) 1\n$ESTIMATION METHOD=0 SIGDIGITS=3 MAXEVALS=450 PRINT=5\n$COVARIANCE\n$TABLE TIME F FILE=nelson_1.out\n@\n',3);
INSERT INTO model VALUES (13,'Norris','Linear regression','head	1.1;\naccess;\nsymbols;\nlocks; strict;\ncomment	@# @;\n\n\n1.1\ndate	2004.04.27.16.47.10;	author vicini;	state Exp;\nbranches;\nnext	;\n\n\ndesc\n@@\n\n\n1.1\nlog\n@@\ntext\n@$PROBLEM NORRIS LINEAR LEAST SQUARES\n$DATA norris.txt\n$INPUT DV TIME\n$PRED \nb0 = THETA(1)\n\nb1 = THETA(2)\n\nx = TIME\n\nF = b0 + b1*x  \n\nY = F + ETA(1)\n$THETA \n(0.02,0.2,2.0)\n(0.1,1,10.0)\n$OMEGA DIAGONAL(1) 1\n$ESTIMATION METHOD=0 SIGDIGITS=3 MAXEVALS=450 PRINT=5\n$COVARIANCE\n$TABLE TIME F FILE=norris.out\n$SCATTERPLOT DV PRED VS TIME FROM 1 TO 900 UNIT ABS0 ORD0\n@\n',3);
INSERT INTO model VALUES (14,'ROSZMAN1','http://www.itl.nist.gov/div898/strd/nls/data/roszman1.shtml','head	1.2;\naccess;\nsymbols;\nlocks; strict;\ncomment	@# @;\n\n\n1.2\ndate	2004.05.21.16.11.35;	author vicini;	state Exp;\nbranches;\nnext	1.1;\n\n1.1\ndate	2004.05.21.16.10.53;	author vicini;	state Exp;\nbranches;\nnext	;\n\n\ndesc\n@@\n\n\n1.2\nlog\n@roszman1_2 new initial conditions\n@\ntext\n@$PROBLEM ROSZMAN1_2\n$DATA roszman.txt\n$INPUT TIME DV\n$PRED \nB1 = THETA(1)\nB2 = THETA(2)\nB3 = THETA(3)\nB4 = THETA(4)\nX = TIME\nF = B1 - B2 * (-X) - ( ATAN ( B3 / (-X-B4) ) ) / 3.141592653589790\nY = F + ETA(1)\n$THETA \n(0.02,0.2,2.0)\n(-0.00005,-0.000005,-0.0000005)\n(120.0,1200,12000.0)\n(-1500.0,-150,-15.0)\n$OMEGA DIAGONAL(1) 0.00001\n$ESTIMATION METHOD=0 SIGDIGITS=3 MAXEVALS=450 PRINT=5\n$COVARIANCE\n$TABLE TIME F FILE=roszman1_2.out\n$SCATTERPLOT TIME VS DV PRED WRES FROM 1 TO 25 UNIT ABS0 ORD0\n@\n\n\n1.1\nlog\n@@\ntext\n@d1 1\na1 1\n$PROBLEM ROSZMAN1_1\nd13 4\na16 4\n(0.01,0.1,1.0)\n(-0.0001,-0.00001,-0.000001)\n(100.0,1000,10000.0)\n(-1000.0,-100,-10.0)\nd20 2\na21 2\n$TABLE TIME F FILE=roszman1_1.out\n$SCATTERPLOT TIME VS DV PRED FROM 1 TO 25 UNIT ABS0 ORD0\n@\n',3);
INSERT INTO model VALUES (15,'EMAX MODEL','Emax model with first-order estimation','head	1.5;\naccess;\nsymbols;\nlocks; strict;\ncomment	@# @;\n\n\n1.5\ndate	2004.05.25.12.12.06;	author vicini;	state Exp;\nbranches;\nnext	1.4;\n\n1.4\ndate	2004.05.25.12.06.20;	author vicini;	state Exp;\nbranches;\nnext	1.3;\n\n1.3\ndate	2004.05.25.11.59.35;	author vicini;	state Exp;\nbranches;\nnext	1.2;\n\n1.2\ndate	2004.05.21.16.23.41;	author vicini;	state Exp;\nbranches;\nnext	1.1;\n\n1.1\ndate	2004.05.21.16.21.19;	author vicini;	state Exp;\nbranches;\nnext	;\n\n\ndesc\n@@\n\n\n1.5\nlog\n@Emax model with LAPLACE estimation\n@\ntext\n@$PROBLEM EMAX MODEL TEST LAPLACE ESTIMATION\n$DATA emax.txt\n$INPUT ID TIME DV\n$PRED \nEMAX = THETA(1)*EXP(ETA(1))\nEC50  = THETA(2)*EXP(ETA(2))\nF = EMAX * TIME / (TIME + EC50)\nY = F + EPS(1)\n$THETA \n(10.0,100,1000)\n(5.0,50,500)\n$OMEGA DIAGONAL(2) 0.02 0.02\n$SIGMA DIAGONAL(1) 1\n$ESTIMATION METHOD=1 LAPLACIAN SIGDIGITS=3 MAXEVALS=450 PRINT=5\n$COVARIANCE\n$TABLE TIME F Y BY TIME FILE=EMAX_LAPLACE.out\n$SCATTERPLOT DV PRED WRES ETA(1) ETA(2) VS TIME BY ID FROM 1 TO 500 UNIT ABS0 ORD0\n@\n\n\n1.4\nlog\n@Emax model with EH-INTR estimation\n@\ntext\n@d1 1\na1 1\n$PROBLEM EMAX MODEL TEST 1 EH-FOCE-INTR ESTIMATION\nd14 1\na14 1\n$ESTIMATION METHOD=1 INTERACTION SIGDIGITS=3 MAXEVALS=450 PRINT=5\nd16 1\na16 1\n$TABLE TIME F Y BY TIME FILE=EMAX_FOCE_INTR.out\n@\n\n\n1.3\nlog\n@Emax model with EH estimation using omega 0.2 and 0.2\n@\ntext\n@d1 1\na1 1\n$PROBLEM EMAX MODEL TEST 1 EH-FOCE ESTIMATION\nd12 1\na12 1\n$OMEGA DIAGONAL(2) 0.2 0.2\nd14 1\na14 1\n$ESTIMATION METHOD=1 SIGDIGITS=3 MAXEVALS=450 PRINT=5\nd16 1\na16 1\n$TABLE TIME F Y BY TIME FILE=EMAX_FOCE_2.out\n@\n\n\n1.2\nlog\n@Emax model with EH estimation\n@\ntext\n@d12 1\na12 1\n$OMEGA DIAGONAL(2) 0.02 0.02\nd16 1\na16 1\n$TABLE TIME F Y BY TIME FILE=EMAX_FOCE.out\n@\n\n\n1.1\nlog\n@@\ntext\n@d1 1\na1 1\n$PROBLEM EMAX MODEL TEST 1 FO ESTIMATION\nd14 1\na14 1\n$ESTIMATION METHOD=0 POSTHOC SIGDIGITS=3 MAXEVALS=450 PRINT=5\nd16 1\na16 1\n$TABLE TIME F Y BY TIME FILE=EMAX_FO.out\n@\n',3);
INSERT INTO model VALUES (16,'Single Exponential I','Cadralazine data model - Single Exponential IV model','head	1.1;\naccess;\nsymbols;\nlocks; strict;\ncomment	@# @;\n\n\n1.1\ndate	2004.05.24.09.15.56;	author vicini;	state Exp;\nbranches;\nnext	;\n\n\ndesc\n@@\n\n\n1.1\nlog\n@@\ntext\n@$PROBLEM CADRALAZINE 1_EXP\n$DATA cadralazine.txt\n$INPUT ID TIME DV\n$PRED \nD = 30\n\nCL = THETA(1)*EXP(ETA(1))\n\nV = THETA(2)*EXP(ETA(2))\n\nF = D/V*EXP(-CL/V*TIME)\n\nY = F + EPS(1)\n$THETA \n(3.0,30,300.0)\n(0.5,5,50.0)\n$OMEGA DIAGONAL(2) 0.09 0.09\n$SIGMA DIAGONAL(1) 0.03\n$ESTIMATION METHOD=0 POSTHOC SIGDIGITS=3 MAXEVALS=450 PRINT=5\n$COVARIANCE \n$TABLE Y FILE=cadralazine.out\n$SCATTERPLOT TIME VS DV PRED RES WRES FROM 1 TO 64 UNIT ABS0 ORD0\n@\n',3);
INSERT INTO model VALUES (17,'Brad','','head	1.1;\naccess;\nsymbols;\nlocks; strict;\ncomment	@# @;\n\n\n1.1\ndate	2004.05.24.17.10.42;	author vicini;	state Exp;\nbranches;\nnext	;\n\n\ndesc\n@@\n\n\n1.1\nlog\n@@\ntext\n@$PROBLEM BradLinearModel\n$DATA BradLinearModel.dat\n$INPUT ID TIME DV\n$PRED \n: FIXED EFFECT THETA(1)  IS THE SLOPE OF THE LINE\n; RANDOM EFFECT ETA(1) IS THE INTERCEPT OF THE LINE\n; MEASUREMENT ERROR IS EPS(1)\n;\n; MODEL FOR THE MEAN GIVEN THE RANDOM EFFECTS\nF = THETA(1) * TIME + ETA(1)\n;\n; MODEL FOR THE DATA FIVEN THE MEASUREMENT ERROR\nY = F + EPS(1)\n$THETA \n(0,.5,2)\n$OMEGA DIAGONAL(1) 1\n$SIGMA DIAGONAL(1) 1\n$ESTIMATION METHOD=0 POSTHOC SIGDIGITS=3 MAXEVALS=450 PRINT=5\n$COVARIANCE\n$TABLE TIME F BY TIME FILE=BradLinearModel.out ONEHEADER\n$SCATTERPLOT TIME VS F BY ID FROM 1 TO 6 NOABS0 NOORD0\n@\n',3);
